--
-- Drop trigger "DOCUMENT_BI"
--
DROP TRIGGER DOCUMENT_BI;

--
-- Create trigger "DOCUMENT_BI"
--
CREATE TRIGGER DOCUMENT_BI
  BEFORE INSERT
  ON DOCUMENT
  FOR EACH ROW
BEGIN
  IF :NEW.DOCNUM IS NULL
  THEN
    :NEW.DOCNUM := DOCNUM_SEQ.NEXTVAL;
  END IF;
END;
/

COMMIT;

-- 
-- Set default schema
--
DECLARE
  p VARCHAR2(255);
BEGIN 
  SELECT USER INTO p FROM DUAL;
  EXECUTE IMMEDIATE 'ALTER SESSION SET CURRENT_SCHEMA = ' || p;
END;
